import React from "react";
import { Avatar, List, Card } from "antd";
const data = [
  {
    title: "Ant Design Title 1",
  },
  {
    title: "Ant Design Title 2",
  },
  {
    title: "Ant Design Title 3",
  },
  {
    title: "Ant Design Title 4",
  },
  {
    title: "Ant Design Title 1",
  },
  {
    title: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Porro amet distinctio sapiente magnam adipisci suscipit dolorum atque incidunt perferendis illum officia dolore iure fugit, voluptas doloribus sunt repellendus minus? Non.,"
  }
];
const Tools = () => (
  <div>
    <Card
      style={{
        "border-radius": "none"
      }}
    >
      <p>DesAIgn Tools List</p>
    </Card>
    <List
      itemLayout="horizontal"
      dataSource={data}
      renderItem={(item, index) => (
        <List.Item>
          <List.Item.Meta
            avatar={
              <Avatar
                src={`https://xsgames.co/randomusers/avatar.php?g=pixel&key=${index}`}
              />
            }
            title={<a href="https://ant.design">{item.title}</a>}
            description="Ant Design, a design language for background applications, is refined by Ant UED Team"
          />
        </List.Item>
      )}
    />
  </div>
);
export default Tools;
